import React, { Component } from 'react'

export default class Sidenav extends Component {
    render() {
        let a = import('./NavComponents').then(res=> res.NavComponents);
        return (
            <div className="side-nav">
                {a.map(x=>{
                    <li>{a.id}</li>
                })}
            </div>
        )
    }
}
